import React from "react";

export default function({recipePerPage,allRecipes,paginado}){
  const pageNumber= [];
  for(let i=1;i<=Math.ceil(allRecipes/recipePerPage);i++){
    pageNumber.push(i);
  }
  return(
    <nav>
      <ul>
        {
          pageNumber?.map((number)=>  {
            <a onClick={() => paginado(number)}>{number}</a>
          })
        }
      </ul>
    </nav>
  )
}
